import { useEffect, useState } from "react"
import todoItem from "../models/todoItem"

const useFetch=(url: string)=>{
    const [data,setData] = useState<todoItem[]>([])

    useEffect(()=>{
        fetch(url)
     .then(res=>res.json())
     .then(data=>{
        setData(data)
     })
    },[url])

    return [data,setData] as [todoItem[],React.Dispatch<React.SetStateAction<todoItem[]>>]
    // return [data,setData]!
    // return data
}

export default useFetch;
